import React from 'react'
import { inject, observer } from 'mobx-react'

import SubmitQuestion from './SubmitQuestion'
import UserQuestions from './UserQuestions'
import QnAPublicView from '../QnAManagementCollapse/QnAPublicView'

// @withRouter
@inject(({ stores }) => stores)
@observer
class QnACollapse extends React.Component {
  constructor(props) {
    super(props)
    this.state = {}
  }

  render() {
    const {
      props: {
        conferenceState,
        conferenceState: { hasQnA, activeQnA, myUserId }
      }
    } = this

    const selectedTabs = [
      conferenceState.isShowPoll,
      conferenceState.isShowPollManagement,
      conferenceState.isShowParticipants,
      conferenceState.isShowMessages,
      conferenceState.isShowAttendancesManagement,
      conferenceState.isShowQnAManagement,
      conferenceState.isShowQnA
    ].filter(e => e).length

    return (
      <div className='qna-container' style={{ height: `calc(100vh - ${selectedTabs * 20 + 1}px)` }}>
        {hasQnA && (
          <>
            <SubmitQuestion activeQnA={activeQnA} />
            <UserQuestions activeQnA={activeQnA} myUserId={myUserId} />
            <QnAPublicView publicQnA={activeQnA.QNA || []} authorizedView={false} />
          </>
        )}
      </div>
    )
  }
}

export default QnACollapse
